import React from "react";

const styles = {
    color: '#f6dde8',
    display: "flex", 
    justifyContent: "flex-end",
    fontSize: calc('10px + 2vmin')
}
const Navigation = () => {
  return (
    <nav style={styles}>
      <p>About</p>
      <p>Portfolio</p>
    </nav>
  );
};

export default Navigation;
